               @RTOId,    
               @IsBrandNew    
               );-- StageID Set as PreQuote once create a new lead        
         END    
      END    
      ELSE    
      BEGIN    
         SELECT @LeadId = 'HERO/ENQ/' + CAST(NEXT VALUE FOR [dbo].[SEQ_LeadTransactionId] AS VARCHAR(10))    

         IF @VehicleTypeId = '88a807b3-90e4-484b-b5d2-65059a8e1a91'    
