CREATE     PROCEDURE [dbo].[Insurance_UpdateUIICCKYCPOAStatus]     
@QuotetransactionId VARCHAR(50) = NULL,
@CKYCStatus VARCHAR(50) = NULL,
@OEMUniqId VARCHAR(50) = NULL
AS

BEGIN
    DECLARE @outputString NVARCHAR(MAX) = '';
    DECLARE @index INT = 1;

    WHILE @index <= LEN(@inputString)
    BEGIN
        DECLARE @char NCHAR(1) = SUBSTRING(@inputString, @index, 1);

        IF PATINDEX('%[a-zA-Z0-9]%', @char) > 0
        BEGIN
            SET @outputString = @outputString + @char;
        END

        SET @index = @index + 1;
    END

    RETURN @outputString;
END;

